std::string blockAsString(lexcontext& ctx)
{
	std::string str;
	
	for (;;)
	{
		char c;
		ctx.in.get(c);
		str.push_back(c);
		if (str.length() >= 4)
		{
			std::string eos = str.substr(str.length() - 4, 4);
			for (char& c : eos)
			{
				c = std::tolower(c);
			}
			if (eos == ".end") break;
		}
	}

	return str.substr(0, str.length() - 4);
}

